import React, {useState} from 'react';
import {CounterInput} from "./CounterInput";
import {CounterButton} from "./CounterButton";

export type SetCounterPropsType = {
    value:number
    minValue: (value:number) => void
    maxValue: (value:number) => void
}


export const SetCounter = (props: SetCounterPropsType) => {

    return (
     <div>
        <div>
           <CounterInput value={props.value} callback={props.minValue}/>
           <CounterInput value={props.value} callback={props.maxValue}/>
              <CounterButton name={'Set'} callback={()=> {}}/>
        </div>
     </div>
   );
};
